import React, { Component } from 'react'

export default class Account extends Component {
    render() {
        return (
            <div>
                <h1>Account Management</h1>
                <h2>Select what account you would like to look up</h2>
                <a href="update_role">Update user role</a>
            </div>
        )
    }
}
